import React, { useState } from 'react';

const IncNumber=()=>{
    const state=useState();
    let [count,update]=useState(0);

    const IncNum=()=>{
        update(count + 1);
    };

    return(
    <>
    
        <div style={{display:'flex',flexDirection:'column',justifyContent:'center',alignItems:'center'}}>
            <h3>{count}</h3>
            <button onClick={IncNum} style={{padding:'0.5rem',color:'white',backgroundColor:'purple',outline:'none',borderRadius:'10px',border:'0px',margin: '-15px 0 16px 0'}}>CLICK ME</button>
        </div>
    </>)
}

export default IncNumber;
